tables.table_schema:
CREATE TABLE historical_data (
    id INT PRIMARY KEY,
    data_time TIMESTAMP,
    data_value DECIMAL
);

CREATE TABLE quantum_hardware_performance (
    hardware_id INT PRIMARY KEY,
    performance_metric VARCHAR,
    prediction_score DOUBLE PRECISION
);

CREATE TABLE hardware_performance (
  id INT PRIMARY KEY,
  model_name VARCHAR(100),
  performance_score INT,
  date_measured DATE
);

CREATE TABLE historical_data (
    id INT PRIMARY KEY,
    data VARCHAR(255),
    date DATE
);

CREATE TABLE prediction_data (
    id INT PRIMARY KEY,
    prediction VARCHAR(255),
    accuracy FLOAT
);

CREATE TABLE quantum_hardware (
    id INT PRIMARY KEY,
    hardware_name VARCHAR(50),
    manufacturer VARCHAR(50),
    performance FLOAT
);

CREATE TABLE future_trends (
    id INT PRIMARY KEY,
    trend_name VARCHAR(100),
    trend_description TEXT,
    predicted_date DATE
);

CREATE TABLE quantum_hardware_data (
    hardware_id INT PRIMARY KEY,
    hardware_name VARCHAR(100),
    manufacturing_date DATE,
    performance_score INT
);
